import React from "react";
import imagenes from "./assets/imagenes"; // 游댠 Importamos el 치lbum de im치genes

const Galeria = () => {
  // 游댠 Lista de im치genes
  const imagenLista = [
    imagenes.img11, imagenes.img22, imagenes.img41,
    imagenes.img12, imagenes.img31, imagenes.img51,
    imagenes.img21, imagenes.img32, imagenes.img52
  ];

  return (
    <div className="container">
      {imagenLista.map((imagen, index) => (
        <div key={index} className="item">
          <img src={imagen} alt={`Imagen ${index + 1}`} />
        </div>
      ))}
    </div>
  );
};

export default Galeria;
